import React from 'react';
import { Link } from 'react-router-dom';
import { makeStyles } from '@material-ui/core/styles';
import { AppBar, Toolbar, Typography, List, ListItem, ListItemIcon, ListItemText, IconButton, Drawer } from '@material-ui/core';
import { Home, Description, WbIncandescent, Info, Mail, Menu as MenuIcon, Close as CloseIcon } from '@material-ui/icons';

const useStyles = makeStyles((theme) => ({
  appBar: {
    background: '#805b00', // --primary-100
    boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.1)',
  },
  toolbar: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  logo: {
    color: '#d3f1ff', // --text-100
    textDecoration: 'none',
    marginRight: '2rem',
  },
  listItem: {
    color: '#95cce7', // --text-200
    marginLeft: '2rem',
  },
  menuButton: {
    color: '#d3f1ff', // --text-100
  },
  drawer: {
    width: 250,
    background: '#023047', // --bg-100
  },
}));

const Header = () => {
  const classes = useStyles();
  const [isDrawerOpen, setIsDrawerOpen] = React.useState(false);
  const isMobile = window.innerWidth < 768;

  const toggleDrawer = () => {
    setIsDrawerOpen(!isDrawerOpen);
  };

  const closeDrawer = () => {
    setIsDrawerOpen(false);
  };

  return (
    <AppBar position="static" className={classes.appBar}>
      <Toolbar className={classes.toolbar}>
        <Typography variant="h6" component={Link} to="/" className={classes.logo}>
          DevWise
        </Typography>
        {isMobile ? (
          <>
            <IconButton edge="end" color="inherit" aria-label="menu" onClick={toggleDrawer}>
              {isDrawerOpen ? <CloseIcon /> : <MenuIcon />}
            </IconButton>
            <Drawer anchor="right" open={isDrawerOpen} onClose={closeDrawer}>
              <List className={classes.drawer}>
                <ListItem button component={Link} to="/" onClick={closeDrawer}>
                  <ListItemIcon><Home /></ListItemIcon>
                  <ListItemText primary="Início" />
                </ListItem>
                <ListItem button component={Link} to="/articles" onClick={closeDrawer}>
                  <ListItemIcon><Description /></ListItemIcon>
                  <ListItemText primary="Artigos" />
                </ListItem>
                <ListItem button component={Link} to="/tutorials" onClick={closeDrawer}>
                  <ListItemIcon><Home /></ListItemIcon>
                  <ListItemText primary="Tutoriais" />
                </ListItem>
                <ListItem button component={Link} to="/tips" onClick={closeDrawer}>
                  <ListItemIcon><WbIncandescent /></ListItemIcon>
                  <ListItemText primary="Dicas" />
                </ListItem>
                <ListItem button component={Link} to="/about" onClick={closeDrawer}>
                  <ListItemIcon><Info /></ListItemIcon>
                  <ListItemText primary="Sobre" />
                </ListItem>
                <ListItem button component={Link} to="/contact" onClick={closeDrawer}>
                  <ListItemIcon><Mail /></ListItemIcon>
                  <ListItemText primary="Contato" />
                </ListItem>
              </List>
            </Drawer>
          </>
        ) : (
          <List component="nav" className={classes.navMenu}>
            <ListItem button component={Link} to="/">
              <ListItemIcon><Home /></ListItemIcon>
              <ListItemText primary="Início" />
            </ListItem>
            <ListItem button component={Link} to="/articles">
              <ListItemIcon><Description /></ListItemIcon>
              <ListItemText primary="Artigos" />
            </ListItem>
            <ListItem button component={Link} to="/tutorials">
              <ListItemIcon><Home /></ListItemIcon>
              <ListItemText primary="Tutoriais" />
            </ListItem>
            <ListItem button component={Link} to="/tips">
              <ListItemIcon><WbIncandescent /></ListItemIcon>
              <ListItemText primary="Dicas" />
            </ListItem>
            <ListItem button component={Link} to="/about">
              <ListItemIcon><Info /></ListItemIcon>
              <ListItemText primary="Sobre" />
            </ListItem>
            <ListItem button component={Link} to="/contact">
              <ListItemIcon><Mail /></ListItemIcon>
              <ListItemText primary="Contato" />
            </ListItem>
          </List>
        )}
      </Toolbar>
    </AppBar>
  );
};

export default Header;
